### 2.3 MixUp Augmentation Strategy

Since our training methodology is based on patches, patches in one mini-batch inevitably contain negative samples, which entirely belong to the background category. To mitigate the impact of these negative samples and to encourage the network to learn the distribution across different classes, we employ the MixUp [18] technique to augment our dataset. MixUp creates new training examples by linearly interpolating between pairs of samples, which helps the model

to generalize better across class boundaries. The process is defined by the following equations:

$$
\begin{aligned}
\tilde{x} & =\lambda x_{i}+(1-\lambda) x_{j} \\
\tilde{y} & =\lambda y_{i}+(1-\lambda) y_{j}
\end{aligned}
$$

where $x_{i}$ and $x_{j}$ are raw input patches from different images, $y_{i}$ and $y_{j}$ are the corresponding one-hot labels, and $\lambda$ is a parameter in the range $[0,1]$ that controls the interpolation. In our experiments, $\lambda$ is sampled from the Beta distribution, which provides a flexible way to control the mixing ratio. During training, both the newly created examples from MixUp and the original samples are used in each batch, allowing the model to learn from a more diverse set of examples.
